            byteArray[i] = base64Data.charCodeAt(i)
        }
        console.log(byteArray)//全是数字

        //实例化二进制对象，底层的二进制
        const blob = new Blob([byteArray], { type: 'image/png' })
        const imggeUrl = URL.createObjectURL(blob)
        
       document.getElementById('blobImage').src = imggeUrl
